import { ObjectId } from "mongodb";
import { useEffect, useState } from "react";

import { Link } from "react-router-dom";
import Navbar from "./Navbar.page";
import ListContactos from "../components/Contactos/ListContactos.jsx";
import * as ContactService from "../services/contactos.services";

function Contactos() {
    // const [contactos, setContactos] = useState([]);

    useEffect(() => {
        ContactService.findContacts()
        .then(contacts => {
            console.log('%cContactos.page.jsx line:13 contacts', 'color: #007acc;', contacts);
            
            contacts.forEach(contact => {
                console.log('%cContactos.page.jsx line:15 contsct', 'color: #007acc;', contact);
                let oid = new ObjectId(contact.friend_id);
                console.log('%cContactos.page.jsx line:18 oid', 'color: #007acc;', oid);
            });

            // setContactos(friends)
        })
        .catch(error => {
            console.log("error", error);
        });
        // eslint-disable-next-line
    }, []);

    return (
        <>
            <Navbar />
            <div className="container">
                <div className="d-flex justify-content-between">
                    <h1>Contactos</h1>
                    <Link className="lh-3" to="/buscarContactos">Buscar Contactos</Link>
                </div>
                <div className="row">
                    {/* {contactos.map(contacto => (
                        <ListContactos key={contacto.contact._id} contacto={contacto.contact} />
                    ))} */}
                </div>
            </div>
        </>
    );
}

export default Contactos;
